import React from "react";
import { Wrap, Title } from "../styles/About";

function About() {
  return (
    <Wrap>
      <div className="container">
        <Title>About Us</Title>
        <FlexItem>
          <FlexText>
            Sourcing the most talented technology focused senior profiles for
            Product , Engineering and Design. Individual searches with dedicated
            search team through to onsite embedded solutions as part of your in
            house offering for larger recruitment projects.
          </FlexText>
        </FlexItem>
      </div>
    </Wrap>
  );
}

export default About;
